function split_token($token) {
    $arr = explode('.', $token);
    $arr[0] = json_decode(base64_decode($arr[0]), true);
    $arr[1] = json_decode(base64_decode($arr[1]), true);
    $arr[1]['exp_date'] = date('Y-m-d H:i:s', $arr[1]['exp']);
    return $arr;
}

